import Header from "../components/Header";
import Hero from "../components/Hero";
import OurStory from "../components/OurStory";
function HomePage() {
  return (
    <Fragment>
      <Header />
      <Hero />
      <OurStory/>
    </Fragment>
  );
}

export default HomePage;
